  \"Assessment of visible vegetation injury and forest health at Cape Romain National
  Wildlife Refuge, South Carolina, after Hurricane Hugo\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 12,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:43.895092\",\n\t\"name\": \"assessment-of-visible-vegetation-injury-and-forest-health-at-cape-romain-national-wildlife\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The forests and upland communities of the
  CRNWR have changed dramatically between 1988 and 1992. Although both the extent
  and magnitude of pollution-like symptomology have increased, it is temporally inconsistent
  with the pollution exposure data recorded in and around the refuge. Since symptomology
  increased at a time when exposure remained constant or decreased, it is unlikely
  that O3 or SO2 is the cause of the significant increase in interveinal chlorosis.
  The most likely cause is the increased exposure to NaCl, both as an aerosol and
  in the soil solution. The forested stands on the CRNWR were altered significantly
  by Hurricane Hugo. Stands previously dominated by loblolly pine were decimated but
  will probably return on areas that received a fuel reduction burn. Those areas unburned
  will likely develop into mixed oak-pine stands. The old-growth oak stands remain
  largely intact -- strong evidence of their adaptation to hurricane-disturbed environments.
  The population of Chinese tallowtree is unusually low.\",\n\t\"license_title\":
